import React from 'react'
import axios from 'axios'

let data=[
    {
        Building:'1',
        RoomId:'Lobby',
        Sensors:'3',
        CurrentPopulation:'3'
    },
    {
        Building:'1',
        RoomId:'Room1',
        Sensors:'3',
        CurrentPopulation:'3'
    },
    {
        Building:'1',
        RoomId:'Room2',
        Sensors:'3',
        CurrentPopulation:'3'
    }
]

const CardList = () =>{
    return(
        <div style={{backgroundColor:'#EEEEEE', height:'80vh',width:'100%'}}>
            {
                data.map((element) =>{
                    return(
                        <div style={{borderRadius:'4px', height:"200px",width:"80%"}}>
                            <div className="ml-4">
                                {element.RoomId}
                            </div>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default CardList
